Its not terribly exciting to only talk about fixed values like 10 or true. To be more useful, flux lets you index types by refinement parameters . For example you can write #[flux::sig(fn(n:i32) -> bool[0 < n])]
pub fn is_pos(n: i32) -> bool { if 0 < n { true } else { false }
} Here, the type says that is_pos takes as input some i32 indexed by n returns as output the bool indexed by 0 < n in other words, the output is true exactly when 0 < n. We might use this function to check that: pub fn test_pos(n: i32) { let m = if is_pos(n) { n - 1 } else { 0 }; assert(0 <= m);
}

