Often we don't care about the exact value of a thing -- but just care about some properties that it may have. For example, we don't care that an i32 is equal to 5 or 10 or n but that it is non-negative. Type Meaning i32{v: 0 < v} The set of i32 values that positive i32{v: n <= v} The set of i32 values greater than or equal to n Flux allows such specifications by pairing plain Rust types with assertions [1] that constrain the value. For example, we can rewrite mk_10 with the output type i32{v:0<v} that specifies a weaker property: the value returned by mk_ten is positive. #[flux::sig(fn() -> i32{v: 0 < v})]
pub fn mk_ten() -> i32 { 5 + 5
} Similarly, you might specify that a function that computes the absolute value of an i32 with a type which says the result is non-negative and exceeds the input n. #[flux::sig(fn (n:i32) -> i32{v:0<=v && n<=v})]
pub fn abs(n: i32) -> i32 { if 0 <= n { n } else { 0 - n }
} As a last example, you might write a function to compute the factorial of n #[flux::sig(fn (n:i32) -> i32{v:1<=v && n<=v})]
pub fn factorial(n: i32) -> i32 { let mut i = 0; let mut res = 1; while i < n { i += 1; res = res * i; } res
} Here the specification says the input must be non-negative, and the output is at least as large as the input. Note, that unlike the previous examples, here we're actually changing the values of i and res. Can you guess why the copilot suggestions failed to pass flux, and what refinements were inferred for i and res in the fixed code at the end?

