Exclusive ownership suffices for simple local updates like in factorial. However, for more complex data, functions must temporarily relinquish ownership to allow other functions to mutate the data. Rust cleverly allows this via the notion of borrowing using two kinds of references that give callees temporary access to a memory location. The simplest kind of references are of the form &T which denote read-only access to a value of type T. For example, we might write abs to take a shared reference to an i32 #[flux::sig(fn (p: &i32[@n]) -> i32{v:0<=v && n<=v})]
pub fn abs(p: &i32) -> i32 { let n = *p; if 0 <= n { n } else { 0 - n }
} Notice that the input type has changed: the function now Accepts p a reference to an i32 whose value is n as denoted by @n Returns an i32 that is non-negative and larger than n The @ marks the n as a refinement parameter whose value is automatically computed by flux during type checking. So, for example, Flux can check the below code by automatically determining that the refinement parameter at the call-site is 10. pub fn test_abs() { let z = 10; assert(0 <= abs(&z)) assert(10 <= abs(&z))
}

