References of type &mut T denote mutable references that can be used to (read and) write or update the contents of a T value. Crucially, Rust ensures that while there may be multiple read-only (shared) references to a location, there is at most one active writeable (mutable) reference at any point in time. Flux exploits the semantics of &mut T to treat T as an invariant of the underlying data. As an example, consider the following function that decrements the value of a mutable reference while ensuring the data is non-negative: #[flux::sig(fn(p: &mut i32{v:0 <= v}))]
pub fn decr(p: &mut i32) { *p = *p - 1;
} Flux will complain with the following message error[FLUX]: assignment might be unsafe --> src/basics.rs:13:9 |
13 | *p = *p - 1; | ^^^^^^^^^^^ as in fact, we may be writing a negative value into *p if, for example, the old value was zero. We can fix this code by guarding the update with a test that ensures the original contents are in fact non-zero #[flux::sig(fn(p: &mut i32{v:0 <= v}))]
pub fn decr(p: &mut i32) { let n = *p; if n != 0 { *p = n - 1; }
} at which point Flux is happy to sign off on the code.

