#![register_tool(flux)] #[flux::sig(fn(x: i32) -> i32{v: x < v})]
pub fn inc(x: i32) -> i32 { x - 1
} You can save the above snippet in say test0.rs and then run rustc-flux --crate-type=lib path/to/test0.rs you should see in your output error[FLUX]: postcondition might not hold --> test0.rs:6:5 |
